import React from "react";
import UserItems from "./UserItems";
import Spinner from "../layout/spinner.gif";

const Users = ({ users, loading }) => {
  return (
    <div>
      {users.map(user => (
        <UserItems key={user.id} user={user} />
      ))}
    </div>
  );
};

export default Users;
